// libera campo entrada de daods e rodapé. Esconde explicação
function dv_Entendi(){
    document.getElementById("dv-entrada-de-dados-flexao").style.display = "block";
    document.getElementById("dv-rodape").style.display = "block";
    document.getElementById("dv-explicacao-flexao").style.display = "none";
}

// usuario escolhe se é reta ou obliqua e libera divs correspondentes
function dv_TipoFlexao() {

    //libera a seção de flexao reta
    if (document.getElementById("dv-fle-ret").checked){
        document.getElementById("dv-flexao-reta").style.display = "block";
        document.getElementById("dv-flexao-obliqua").style.display = "none";
        //document.getElementById("dv-resultado-flexao-reta").style.display = "block"; -> Comentei para aparecer informação junto 
        document.getElementById("dv-resultado-flexao-obliqua").style.display = "none";

        document.getElementById("dv-tipo-flexao").style.display = "none";

    }
    //libera a seção de flexao obliqua
    else if (document.getElementById("dv-fle-obl").checked){
        document.getElementById("dv-flexao-reta").style.display = "none";
        document.getElementById("dv-flexao-obliqua").style.display = "block";
        document.getElementById("dv-resultado-flexao-reta").style.display = "none";
        //document.getElementById("dv-resultado-flexao-obliqua").style.display = "block";-> Comentei para aparecer informação junto

        document.getElementById("dv-tipo-flexao").style.display = "none";
    }
    
}

// verifica se foi informado e salva
function dv_Verificar(){
    
    var reta = document.getElementById("dv-fle-ret").checked;
    var obli = document.getElementById("dv-fle-obl").checked;

    // se não foi informado o tipo de flexao
    if((reta === false) && (obli === false)){
        alert("Tipo de flexão não escolhido");
    }
    // se é flexão reta
    if(reta === true){
        sessionStorage.setItem("dv-tipo-flexao", "reta");
        if(document.getElementById("dv-Md").value === ""){
            alert("Valor do momento não informado");
        }
        if(document.getElementById("dv-Md").value != ""){
            document.getElementById("dv-contas-flexao").style.display = "block";

            dvMd = document.getElementById("dv-Md").value;
            dvMd = Number(dvMd);
            dvMd = dvMd*1000;
            sessionStorage.setItem("dv-Md", dvMd)
        }
    }
    // se é flexão obliqua
    if(obli === true){
        sessionStorage.setItem("dv-tipo-flexao", "obliqua");
        if(document.getElementById("dv-Mxd").value === ""){
            alert("Momento atuante em x não informado");
        }
        if(document.getElementById("dv-Myd").value === ""){
            alert("Momento atuante em y não informado");
        }
        if((document.getElementById("dv-Mxd").value != "") && (document.getElementById("dv-Myd").value != "")){
            document.getElementById("dv-contas-flexao").style.display = "block";

            dvMxd = document.getElementById("dv-Mxd").value;
            dvMxd = Number(dvMxd);
            dvMxd = dvMxd*1000;
            sessionStorage.setItem("dv-Mxd", dvMxd)

            dvMyd = document.getElementById("dv-Myd").value;
            dvMyd = Number(dvMyd);
            dvMyd = dvMyd*1000;
            sessionStorage.setItem("dv-Myd", dvMyd)
        }
    }
}

// calcula a flexão simples
function dv_Flexao(){

    var reta = document.getElementById("dv-fle-ret").checked;
    var obli = document.getElementById("dv-fle-obl").checked;

    if(reta == true){
        resposta = 0;

        // pegando valores da memoria
        dvMd = sessionStorage.getItem("dv-Md");
        resgeo = sessionStorage.getItem("dv-resistencia-geo-x");
        flexr = sessionStorage.getItem("dv-resistencia-flexao");

        TMd = (dvMd/resgeo);

        sessionStorage.setItem("dv-tens-flex", TMd);
            
        resposta = TMd/flexr;

        if(resposta <= 1){
            sessionStorage.setItem("dv-flexao", "suporta");

            document.getElementById("dv-resultado-flexao-reta").classList.add("certa");
            document.getElementById("dv-resultado-flexao-reta").className = "certa";
			
            texto1 = "O resultado obtido foi:";
            resposta = resposta.toFixed(3);
            texto2 = "&le;";
            textofinal = texto1.concat(" ", resposta, " ", texto2, " 1");
            document.getElementById("dv-resposta").innerHTML = textofinal;
            document.getElementById("dv-texto").innerHTML = "Portanto a viga suporta a flexão"

            sessionStorage.setItem("dv-flexao-resposta", resposta)

        }
        else{
            sessionStorage.setItem("dv-flexao", "não suporta");

            document.getElementById("dv-resultado-flexao-reta").classList.add("errada");
            document.getElementById("dv-resultado-flexao-reta").className = "errada";
			
            texto1 = "O resultado obtido foi:";
            resposta = resposta.toFixed(3);
            textofinal = texto1.concat(" ", resposta, " > 1");
            document.getElementById("dv-resposta").innerHTML = textofinal;
            document.getElementById("dv-texto").innerHTML = "Portanto a viga não suporta a flexão";

            sessionStorage.setItem("dv-flexao-resposta", resposta)

        }
		document.getElementById("dv-resultado-flexao-reta").style.display = "block";

		
    }
	
    if(obli === true){

        respostax = 0;
        respostay = 0;

        // resuperando valores salvos na memoria
        dvMxd = sessionStorage.getItem("dv-Mxd");
        dvMyd = sessionStorage.getItem("dv-Myd");

        resgeox = sessionStorage.getItem("dv-resistencia-geo-x");
        resgeoy = sessionStorage.getItem("dv-resistencia-geo-y");
        flexr = sessionStorage.getItem("dv-resistencia-flexao");

		TMx = (dvMxd/resgeox);
		TMy = (dvMyd/resgeoy);

        
        sessionStorage.setItem("dv-tens-flex-x", TMx);
        sessionStorage.setItem("dv-tens-flex-y", TMy);

		respostax = TMx/flexr;
        respostay = TMy/flexr;

		dvkm=0.7;
        resposta1 = respostax + dvkm * respostay;
        resposta2 = respostax * dvkm + respostay;
		

		sessionStorage.setItem("dv-fle-obl-resx", resposta1);
		sessionStorage.setItem("dv-fle-obl-resy", resposta2);

        if((resposta1 <= 1) && (resposta2 <= 1)){
           
            sessionStorage.setItem("dv-flexao", "suporta");

            
            document.getElementById("dv-resposta-oblx").classList.add("certa");
            document.getElementById("dv-resposta-oblx").className = "certa";

            document.getElementById("dv-resposta-obly").classList.add("certa");
            document.getElementById("dv-resposta-obly").className = "certa";
			
            texto1 = "O resultado obtido foi:";
            resposta1 = resposta1.toFixed(3);
            resposta2 = resposta2.toFixed(3);
            texto2 = "&le;";

            textofinalx = texto1.concat(" ", resposta1, " ", texto2, " 1");
            textofinaly = texto1.concat(" ", resposta2, " ", texto2, " 1");

            document.getElementById("dv-respostax").innerHTML = textofinalx;
            document.getElementById("dv-textox").innerHTML = "Portanto a viga suporta a flexão em x"

            document.getElementById("dv-respostay").innerHTML = textofinaly;
            document.getElementById("dv-textoy").innerHTML = "Portanto a viga suporta a flexão em y"
			
			
        }
        if((resposta1 > 1) || (resposta2 > 1)){
           
            if((resposta1 > 1) && (resposta2 <= 1)){
            sessionStorage.setItem("dv-flexao", "não suporta");
            sessionStorage.setItem("dv-flexao-nsu", "1");
			
            document.getElementById("dv-resposta-oblx").classList.add("errada");
            document.getElementById("dv-resposta-oblx").className = "errada";

            document.getElementById("dv-resposta-obly").classList.add("certa");
            document.getElementById("dv-resposta-obly").className = "certa";
			
                texto1 = "O resultado obtido foi:";
                resposta1 = resposta1.toFixed(3);
                resposta2 = resposta2.toFixed(3);
                texto2 = "&le;";

                textofinalx = texto1.concat(" ", resposta1, " > 1");
                textofinaly = texto1.concat(" ", resposta2, " ", texto2, " 1");

                document.getElementById("dv-respostax").innerHTML = textofinalx;
                document.getElementById("dv-textox").innerHTML = "Portanto a viga não suporta a flexão em x"

                document.getElementById("dv-respostay").innerHTML = textofinaly;
                document.getElementById("dv-textoy").innerHTML = "Portanto a viga suporta a flexão em y"
		
            }
            if((resposta1 <= 1) && (resposta2 > 1)){
                sessionStorage.setItem("dv-flexao", "não suporta");
                sessionStorage.setItem("dv-flexao-nsu", "2");
                
                document.getElementById("dv-resposta-oblx").classList.add("certa");
                document.getElementById("dv-resposta-oblx").className = "certa";
    
                document.getElementById("dv-resposta-obly").classList.add("errada");
                document.getElementById("dv-resposta-obly").className = "errada";
                
                texto1 = "O resultado obtido foi:";
                resposta1 = resposta1.toFixed(3);
                resposta2 = resposta2.toFixed(3);
                texto2 = "&le;";
    
                textofinalx = texto1.concat(" ", resposta1, " ", texto2, " 1");
                textofinaly = texto1.concat(" ", resposta2, " > 1");
    
                document.getElementById("dv-respostax").innerHTML = textofinalx;
                document.getElementById("dv-textox").innerHTML = "Portanto a viga suporta a flexão em x"
    
                document.getElementById("dv-respostay").innerHTML = textofinaly;
                document.getElementById("dv-textoy").innerHTML = "Portanto a viga não suporta a flexão em y"
            
            }
            if((resposta1 > 1) && (resposta2 > 1)){
                sessionStorage.setItem("dv-flexao", "não suporta");
                sessionStorage.setItem("dv-flexao-nsu", "1,2");
                
                document.getElementById("dv-resposta-oblx").classList.add("errada");
                document.getElementById("dv-resposta-oblx").className = "errada";
    
                document.getElementById("dv-resposta-obly").classList.add("errada");
                document.getElementById("dv-resposta-obly").className = "errada";
                
                texto1 = "O resultado obtido foi:";
                resposta1 = resposta1.toFixed(3);
                resposta2 = resposta2.toFixed(3);
    
                textofinalx = texto1.concat(" ", resposta1, " > 1");
                textofinaly = texto1.concat(" ", resposta2, " > 1");
    
                document.getElementById("dv-respostax").innerHTML = textofinalx;
                document.getElementById("dv-textox").innerHTML = "Portanto viga não suporta a flexão em x"
    
                document.getElementById("dv-respostay").innerHTML = textofinaly;
                document.getElementById("dv-textoy").innerHTML = "Portanto a viga não suporta a flexão em y"
            
            }
        }
		document.getElementById("dv-resultado-flexao-obliqua").style.display = "block";
    }
}

